import React, { useEffect, useState } from "react";

const PreviousValidations = () => {
  const [validations, setValidations] = useState([]);

  useEffect(() => {
    // Fetch previous validations from backend API
    const fetchValidations = async () => {
      try {
        const response = await fetch("https://your-backend-api.com/api/user-goals", {
          method: "GET",
          headers: {
            Authorization: `Bearer ${sessionStorage.getItem("access_token")}`,
            "Content-Type": "application/json",
          },
        });

        if (!response.ok) throw new Error("Failed to fetch data");

        const data = await response.json();
        setValidations(data);
      } catch (error) {
        console.error("Error fetching previous validations:", error);
      }
    };

    fetchValidations();
  }, []);

  return (
    <div className="previous-validations-container">
      <h2>Previous Validations</h2>
      {validations.length === 0 ? (
        <p>No previous validations found.</p>
      ) : (
        <ul>
          {validations.map((validation, index) => (
            <li key={index}>
              <strong>Goal:</strong> {validation.goal} <br />
              <strong>Start Date:</strong> {validation.start_date} <br />
              <strong>End Date:</strong> {validation.end_date} <br />
              <strong>Response:</strong> {validation.response} <br />
              <hr />
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default PreviousValidations;
